import { Navigate, useNavigate } from 'react-router-dom'
import { UserContext } from '../context'
import { useLocalStorage } from '../hooks'
import style from './GameLog.module.css'
import { key } from 'localforage'


export default function GameLog() {

    const [games] = useLocalStorage<Record<string, number[]>>('blackMoves', {})
    const navigate = useNavigate()



  return (
    <div className={style.container}>
      <h1 className={style.header}>You have {Object.keys(games).length} previosly save games</h1>

      <div>




      </div>


            {Object.keys(games).map(
                (key) => {

                    return(
                        <div className={style.list} key={key}>
                        <p className={style.title}>
                          {key} 
                        </p>

                        <button
                          className={style.button}
                          onClick={() => navigate(`/gamehistory/${key}`)}
                        >
                          View
                        </button>
                      </div>
                    )
                }


                )}


      </div>
  )
}
